import React from 'react';
import Avatar from './Avatar';

export default function ChangeUser(props) {
  // function onChangeUser() {

  // }

  return (
    <div>
      <h6>Visualizar Timeline com:</h6>
      <div>
        <div onClick={() => props.onClick('batman')}>
          <Avatar />
        </div>
        <Avatar onClick={() => props.onClick('superman')} />
        <Avatar onClick={() => props.onClick('wonderWoman')} />
      </div>
    </div>
  );
}
